import React from 'react';
import '../css/Subsection.css';

const Subsection = (props) => {
    return (
        <div>
            <img src={props.link} alt="img" className='cimg'/>
            <div className='content_'>
            <h5>{props.title}</h5>
            <p>{props.subtitle}</p>
            </div>
        </div>
    )
}

export default Subsection;
